import React from "react";

interface Props {
  start_x: string;
  start_y: string;
  end_x: string;
  end_y: string;
}

const Arrow = ({ start_x, end_x, start_y, end_y }: Props) => {
  return (
    <svg className="full">
      <line className="arrow" x1={start_x} y1={start_y} x2={end_x} y2={end_y} />
    </svg>
  );
};

export default Arrow;
